import React from 'react';
import Theteam from "./theteam"
import {BrowserRouter, Switch, Route} from "react-router-dom"

export default function Routes(){
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path="/theteam" component={Theteam}></Route>
            </Switch>
        </BrowserRouter>

    );
}
